window.bookSummaryJSON = "<p><b>Warning</b>: This book is for mature listeners only. Not for children. It contains adult themes, violence, coarse language, sexual situations, nudity, and paranormal themes. </p> <p>From author Golden Czermak comes the penultimate installment of the captivating Journeyman Series. Emboldened, Dajjal's forces have begun attacking openly in the streets, spreading fear and pain across the globe. The Order prepares to counter the Infernal Tide in Paris, else be swept away in its fiery waves. Meanwhile, Marcus must overcome past issues with his brother Ty while they search for a cure to heal the love of his life. The road leads them to the mysterious commune of Rennes-le-Chateau in France. All was going so well, then Hell followed with its own moves, threatening the world with eternal fire and shade. </p>"; 
